export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},zOKVZooXIA:{data:{id:1002,attributes:{imdbId:"tt6426404",poster:i,type:c,ratings:[],item_lang:{data:{id:1665,attributes:{title:"Everything",plot:i,slug:"everything"}}},books:{data:[{id:5842,attributes:{title:j,description:f,thumbnail:k,authors:[a],firstBook:true,published:l,publisher:d,subtitle:b}},{id:5843,attributes:{title:"Nicola Yoon 2-Book Bundle: Everything, Everything and The Sun Is Also a Star",description:"This two-book e-bundle includes Nicola Yoon's #1 New York Times bestsellers, EVERYTHING, EVERYTHING and THE SUN IS ALSO A STAR. Everything, Everything is now a motion picture starring Amandla Stenberg and Nick Robinson, and the film of The Sun Is Also a Star is coming to theaters in May 2019! Maddy and Olly. Natasha and Daniel. This e-book collection contains Nicola Yoon's two captivating love stories: Everything, Everything, a #1 New York Times bestseller, and The Sun Is Also a Star, a #1 New York Times bestseller, National Book Award Finalist, and Printz Honor Book. In Everything, Everything, Maddy is a girl who's literally allergic to the outside world, and Olly is the boy who moves in next door . . . and becomes the greatest risk she's ever taken. In The Sun Is Also a Star, Natasha and Daniel are brought together just when it seems like the universe is sending them in opposite directions. Falling in love doesn't seem possible, but fate has something extraordinary in store. Praise for Everything, Everything: \"Gorgeous and lyrical.\" --The New York Times Book Review \"[A] fresh, moving debut.\"--Entertainment Weekly, A- \"YA book lovers, your newest obsession is here.\"--MTV.com Praise for The Sun Is Also a Star: \"Beautifully crafted.\"--People Magazine \"Fans of Yoon's first novel, Everything Everything, will find much to love--if not, more--in what is easily an even stronger follow up.\" --Entertainment Weekly \"Transcends the limits of YA as a human story about falling in love and seeking out our futures.\" --POPSUGAR.com",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PHRfDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2018-10-23",publisher:d,subtitle:b}},{id:5844,attributes:{title:"Everything, Everything Movie Tie-in Edition",description:f,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wrjnDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2017-04-04",publisher:"Ember",subtitle:b}},{id:5845,attributes:{title:j,description:f,thumbnail:k,authors:[a],firstBook:e,published:l,publisher:d,subtitle:b}},{id:5846,attributes:{title:"Random Minis: Everything, Everything",description:"The #1 New York Times bestseller Everything, Everything in a groundbreaking new mini format, perfect for on-the-go reading! Risk everything . . . for love. What if you couldn't touch anything in the outside world? Never breathe in the fresh air, feel the sun warm your face . . . or kiss the boy next door? In Everything, Everything, Maddy is a girl who's literally allergic to the outside world, and Olly is the boy who moves in next door . . . and becomes the greatest risk she's ever taken. My disease is as rare as it is famous. Basically, I'm allergic to the world. I don't leave my house, have not left my house in seventeen years. The only people I ever see are my mom and my nurse, Carla. But then one day, a moving truck arrives next door. I look out my window, and I see him. He's tall, lean, and wearing all black--black T-shirt, black jeans, black sneakers, and a black knit cap that covers his hair completely. He catches me looking and stares at me. I stare right back. His name is Olly. Maybe we can't predict the future, but we can predict some things. For example, I am certainly going to fall in love with Olly. It's almost certainly going to be a disaster. Everything, Everything will make you laugh, cry, and feel everything in between. It's an innovative, inspiring, and heartbreakingly romantic debut novel that unfolds via vignettes, diary entries, illustrations, and more.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qQjewwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2019-10-22",publisher:d,subtitle:b}}]}}},meta:{}}},prerenderedAt:1681703555406}}("Nicola Yoon","","movie","Delacorte Press",null,"Risk everything . . . for love with this #1 New York Times bestseller. What if you couldn’t touch anything in the outside world? Never breathe in the fresh air, feel the sun warm your face . . . or kiss the boy next door? In Everything, Everything, Maddy is a girl who’s literally allergic to the outside world, and Olly is the boy who moves in next door . . . and becomes the greatest risk she’s ever taken. My disease is as rare as it is famous. Basically, I’m allergic to the world. I don’t leave my house, have not left my house in seventeen years. The only people I ever see are my mom and my nurse, Carla. But then one day, a moving truck arrives next door. I look out my window, and I see him. He's tall, lean and wearing all black—black T-shirt, black jeans, black sneakers, and a black knit cap that covers his hair completely. He catches me looking and stares at me. I stare right back. His name is Olly. Maybe we can’t predict the future, but we can predict some things. For example, I am certainly going to fall in love with Olly. It’s almost certainly going to be a disaster. Everything, Everything will make you laugh, cry, and feel everything in between. It's an innovative, inspiring, and heartbreakingly romantic debut novel that unfolds via vignettes, diary entries, illustrations, and more. And don’t miss Nicola Yoon's The Sun Is Also A Star, the #1 New York Times bestseller in which two teens are brought together just when it seems like the universe is sending them in opposite directions.","series",1,"N\u002FA","Everything, Everything","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Bg-8BQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2015-09-01"))